ts/kns/4901490053216.jpg?_ex=40x40&s=0&r=0" border="0"></a></td><td><a href="https://item.rakuten.co.jp/shugei-club/4901490053216/"><font class="link">コニシボンド　学校工作用接着剤　木・紙・布　6ml入　05321<br>162円　（税別・送料別）</font></a></td></tr></table></td></tr><tr><td class="linkframe_main"><table class="products"><tr><td class="image"><a href="https://item.rakuten.co.jp/shugei-club/4901490606238/"><img src="https://thumbnail.image.rakuten.co.jp/@0_mall/shugei-club/cabinet/products/kns/4901490606238.jpg?_ex=40x40&s=0&r=0" border="0"></a></td><td><a href="https://item.rakuten.co.jp/shugei-club/4901490606238/"><font class="link">コニシボンド　ラベルはがし　50ml入　60623<br>538円　（税別・送料別）</font></a></td></tr></table></td></tr><tr><td class="linkframe_main"><table class="products"><tr><td class="image"><a href="https://item.rakuten.co.jp/shugei-club/4901490054763/"><img src="https://thumbnail.image.rakuten.co.jp/@0_mall/shugei-club/cabinet/products/kns/4901490054763.jpg?_ex=40x40&s=0&r=0" border="0"></a></td><td><a href="https://item.rakuten.co.jp/shugei-club/4901490054763/"><font class="link">裁ほう上手　17g入　コニシボンド　裁縫上手　05476<br>320円　（税別・送料別）</font></a></td></tr></table></td></tr><tr><td><img src="http://image.rakuten.co.jp/shugei-club/cabinet/system/img_link_space.gif" width="740" height="15" border="0"></td></tr></table><font color=red size=5><B>超便利!</b></font><br /><font color="dc143c" size=5><B>針・糸がなくてもかばんが作れる手芸ボンド裁縫上手です。</b></font><br /><br />ミシンも針も糸もいらない布用接着剤<br />画期的な手芸用ボンド。<br />洗濯・ドライクリーニングOKです!!<br />これ、ミシンで縫うより丈夫です!強力です!<br /><br />アイロンでさらに強力・塗るだけ、速乾接着!<br />洗たく・ドライクリーニングOK!<br />使いやすい細口ノズルを採用!<br />伸ばし用のヘラ付き!<br />これからの時期、入園や入学、その他イベント事で必ず役に立てると思われます!<br />忙しい主婦の方、赤ちゃんのお世話で忙しいママさんにとっては強力なアイテムとなります!<br />ズボン・スカートのすそ上げにも!<br />超簡単接着で現在注文殺到中です!<br />今流行のカルトナージュにもご利用いただけます。<br />(本来は接着した後にアイロンにて熱を加えて仕上げる商品ですが、当社で試したところ、少し多めに塗ってしっかり乾かせばアイロンがなくても十分に強度がございました。保障はできかねますが、当商品だけで十分に固定できると実感できます。)<br /><br /><font color=red size=4><B><br />★小型宅配便(ゆうパケット)送料無料!★<br /><br />※配送方法は必ず「小型宅配便(ゆうパケット)」を選択してください。<br /><br />※お支払方法で「代引き(代金引換)」をご選択いただいた場合は、<br />「小型宅配便(ゆうパケット)」は選択できません。<br />宅配便送料と手数料が発生します。<br /><br />※同梱物によりゆうパケット規定サイズオーバーとなった場合は、<br />当社指定便(送料有料)に変更させていただきます。</b></font><BR><br /><br />≪用途≫<br />・通園かばん等の製作<br />・名札・リボン・レース付け<br />・ズボン・スカートのすそ上げ<br /><br />●サイズ:80mm×30mm×205mm<br />●容量:45g入り<br /><br />※アイロンを使用した場合<br />　・接着強さは約30％アップします!<br />　・貼り合せ直後でも優れた接着力を発揮します!<br />　(アイロンを使用しない場合でも接着できます)<br /><br />※生地に種類、面積、使用条件によってつきにくい場合があります。<br />※耐えられる重さの目安以内で使用して下さい。<br><br><br><table height="85" width="293" background ="https://image.rakuten.co.jp/shugei-club/cabinet/system/img_mobile_back.gif" border="0"><tr><td width="203"><img src="https://image.rakuten.co.jp/shugei-club/cabinet/system/img_mobile_guide.gif" width="195" height="85" border="0"></td><td width="80"><img src="https://www.rakuten.ne.jp/gold/shugei-club/cabinet/products/kns_qrcode/qr_4901490053711.jpg" width="72" height="72" border="0"></td></tr></table><br><img src="https://image.rakuten.co.jp/shugei-club/cabinet/system/img_pakenomi_enable.gif"   border="0"><b><br><br>※同梱可能な数量は、ゆうパケットでは4個入ります</b><br><font color="#EEEEEE" size="1">cd304031</font><img src="http://image.rakuten.co.jp/shugei-club/cabinet/top/main-title04.gif">

